import razorpayKey from './components/Payment'
import handlePayment from './components/Payment'
// import './Payment.css';

function Product(){
    return (
        <div className="payment-container">
        
             <h1>Razorpay Integration</h1>
         
          <button onClick={handlePayment} disabled={!razorpayKey}>
            Pay Now
          </button>
        </div>
      
      );
}

export default Product;


<div className="payment-container">
<button onClick={handlePayment} disabled={!razorpayKey}>
  Pay Now
</button>
</div>
